import React from 'react';
import { FaMapLocation, FaPhone, FaEnvelope, FaFacebookF, FaXTwitter, FaInstagram, FaYoutube, FaLinkedinIn } from 'react-icons/fa6';
import { motion } from 'framer-motion';

const logoUrl = 'https://prashraya.org/wp-content/uploads/elementor…_n-qtir2fw9zqtc7qrxft7est9yuk34qnuch8ihrepctc.jpg';
const mapLink = 'https://www.google.com/maps/place/22%C2%B040%2710.8%22N+75%C2%B048%2719.0%22E/@22.669667,75.805278,17z';

const colors = {
  darkBlue: '#022b3a',
  blue: '#1f7a8c',
  lightBlue: '#bfdbf7',
  paleBlue: '#e1e5f2',
  white: '#ffffff',
};

const socialLinks = [
  { icon: <FaInstagram />, href: '/' },
  { icon: <FaLinkedinIn />, href: '/' },
  { icon: <FaXTwitter />, href: '/' },
  { icon: <FaYoutube />, href: '/' },
  { icon: <FaFacebookF />, href: '/' },
];

const learnLinks = [
  'About', 'Culture', 'Testimonials', 'Processes', 'FAQs', 'Branding FAQs', 'Blog'
];
const exploreLinks = [
  'Home', 'Work', 'Services', 'Careers', 'Sectors', 'Hex Test', 'Contact'
];

const Footern = () => {
  return (
    <footer style={{ background: colors.darkBlue }} className="relative pt-24 pb-8 min-h-[500px]">
      {/* Socials cutout */}
      <div className="absolute left-0 top-0 flex flex-col items-center gap-4 pt-8 pb-8 px-2 rounded-br-[2.5rem] z-20 shadow-lg"
        style={{ background: colors.lightBlue, width: 70, minHeight: 320 }}>
        {socialLinks.map((s, i) => (
          <a key={i} href={s.href} className="text-[#022b3a] hover:text-[#1f7a8c] transition-colors text-2xl">
            {s.icon}
          </a>
        ))}
      </div>

      {/* Main card */}
      <motion.div
        className="container mx-auto px-0 md:px-8 py-10 rounded-[2.5rem] shadow-2xl flex flex-col md:flex-row gap-10 md:gap-0"
        style={{ background: colors.blue, color: colors.white, borderRadius: '2.5rem', boxShadow: '0 8px 32px rgba(0,0,0,0.12)' }}
        initial={{ opacity: 0, y: 40 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
      >
        {/* Left: Logo, Heading, Button */}
        <div className="md:w-1/3 flex flex-col justify-center items-center md:items-start gap-6 px-8 py-10">
          <img src={logoUrl} alt="Aashraya Logo" className="w-20 h-20 object-contain mb-2" />
          <h2 className="text-3xl font-bold" style={{ color: colors.white }}>Do you like what you see?</h2>
          <button
            className="mt-2 px-6 py-3 rounded-full font-semibold text-lg shadow-md transition-colors"
            style={{ background: colors.lightBlue, color: colors.darkBlue }}
          >
            Start a project
          </button>
        </div>

        {/* Center: Links */}
        <div className="md:w-1/3 flex flex-col md:flex-row justify-center items-center md:items-start gap-10 px-8 py-10">
          <div>
            <h3 className="text-lg font-semibold mb-2" style={{ color: colors.white }}>Learn</h3>
            <ul className="space-y-1">
              {learnLinks.map((l, i) => (
                <li key={i}><a href="/" className="hover:text-[#e1e5f2] transition-colors">{l}</a></li>
              ))}
            </ul>
          </div>
          <div>
            <h3 className="text-lg font-semibold mb-2" style={{ color: colors.white }}>Explore</h3>
            <ul className="space-y-1">
              {exploreLinks.map((l, i) => (
                <li key={i}><a href="/" className="hover:text-[#e1e5f2] transition-colors">{l}</a></li>
              ))}
            </ul>
          </div>
        </div>

        {/* Right: Contact Info */}
        <div className="md:w-1/3 flex flex-col gap-4 px-8 py-10">
          <h3 className="text-lg font-semibold mb-2" style={{ color: colors.white }}>Get in touch</h3>
          <div className="flex items-center gap-2 text-white/90">
            <FaPhone />
            +91 88188 50707
          </div>
          <div className="flex items-center gap-2 text-white/90">
            <FaEnvelope />
            support@prashraya.org
          </div>
          <div className="flex items-center gap-2 text-white/90">
            <FaMapLocation />
            104, Indore, Madhya Pradesh
          </div>
          <a href={mapLink} target="_blank" rel="noopener noreferrer" className="text-sm underline hover:text-[#bfdbf7]">View on Google Maps</a>
        </div>
      </motion.div>

      {/* Bottom row */}
      <div className="container mx-auto px-4 mt-8 flex flex-col md:flex-row items-center justify-between gap-4 text-sm" style={{ color: colors.paleBlue }}>
        <div className="flex gap-4">
          <a href="/" className="hover:underline">Privacy Policy</a>
          <a href="/" className="hover:underline">Terms & Condition</a>
          <a href="/" className="hover:underline">Faq</a>
        </div>
        <div className="text-center md:text-right">Copyright © 2025 Aashraya. All rights reserved.</div>
      </div>
    </footer>
  );
};

export default Footern;
